 INSERT INTO srdb.assessment VALUES('DFO-MAR-WHAKE4VWX5-1964-2005-PREFONTAINE', 'DFO-MAR', 'WHAKE4VWX5', 'PREFONTAINE', '2008-06-18', '2009-03-17 21:09:34', '1964-2005', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'Relative fishing mortality (Frel) can be found in the assessment in Figures 24 and 25; these are estimated from the commercial catch / by the fishable biomass (45 cm +) estimated from summer RV surveys. There are two estimates of length at 50% maturity; L50-1 is for the Scotian Shelf area and L50-2 for the Bay of Fundy area. From these corresponding ages at 50% maturity were calculated. Two reference points are mentioned in the assessment yet no values are given; more information can be found on these in Sosebee, K.A. 2005. Georges Bank/Gulf of Maine White Hake. In. Mayo, R.K. Terceiro,M., editors. 2005. Assessment of 19 Northeast groundfish stocks through 2004.2005 Groundfish Assessment Review Meeting (2005 GARM), Northeast Fisheries Science Center, Woods Hole, Massachusetts,15-19 August 2005. U.S. Dep.Commer., Northeast Fish. Sci. Cent. Ref. Doc. 05-13; pp. 341-358. Catch per unit effort can be found in Figure 6 as the stratified mean catch rates in kilograms per tow.', '', 0, 0, 'Unknown', 'no comments', '../spreadsheets/PREFONTAINE-WHAKE4VWX5-2005-editedDR.xls') ; 
